import React, { Component } from 'react';
import Projects from './projects';

let projects = [{name:"river"}, {name:"double"}, {name:"matchmaking"}]
let projectsList

class ProjectsList extends Component {


  render() {
    projectsList = projects.map((project, index) => {
      return <Projects key={index} toggleDisplay= {this.props.toggleDisplay} project={project}/>
    })
    return(
    	<div className={"featured"}>
    	  {projectsList}
			  	<div className = "highlight spotlight">
					<h5 className = "spotText">
						hover over the featured projects to learn more about them. click on the project to get more indeph information.
					</h5>
				</div>	    	  
    	</div>
    )
  }
}

export default ProjectsList
